import React from 'react';
import BoardForm from '../components/BoardForm';
import BoardItemList from '../components/BoardItemList';

class Board extends React.Component {
  render() {
    return (
      <BoardItemList form={<BoardForm/>}>
        <BoardList />
      </BoardItemList>
    );
  };
}

export default Board;
